export default function Q1(){
    return hotels.map((hotel)=>{
        return (
            <>
                <p>{hotel.id}</p>
                <p>{hotel.nom}</p>
                <p>{hotel.chambers}</p>
                <p>{hotel.chambers}</p>                
            </>
        )
    })
}
